import { useEffect } from "react"
import { useDispatch } from "react-redux"
import styled from "styled-components"
import IconSearch from "../../../assets/search.icon"
import { triggerGetUser } from "../../../store/user"
import { ConnectedMainProps } from "../container/main"
import MainTabel from "./mainTabel"

const Main = ({ users, loading }: ConnectedMainProps) => {
    const dispatch = useDispatch()

    useEffect(() => {
        dispatch(triggerGetUser())
    }, [])

    return (
        <HomeMain>
            <TabelContainer>
                <HeaderMainContainer>
                    <Search>
                        <IconSearch />
                        <Input placeholder='Поиск' />
                    </Search>
                    <Select>
                        <option>Сортировать по</option>
                        <option>Сортировать по</option>
                    </Select>
                </HeaderMainContainer>
                <MainTabel users={users} loading={loading} />
            </TabelContainer>
        </HomeMain>
    )
}

const HomeMain = styled.div`
  width: 100%;
`;

const HeaderMainContainer = styled.div`
padding: 33px 0;
display: flex;
justify-content: space-between;
`;

const Input = styled.input`
background: #F5F8FA;
border-radius: 10px;
width: 281px;
height: 42px;
border: none;
padding-left: 50px;
font-family: 'Gilroy Bold';
font-size: 13px;
color: #A1A5B6;
::placeholder {
    font-family: 'Gilroy Bold';
font-size: 13px;
color: #A1A5B6;
}
`;

const Select = styled.select`

`;

const Search = styled.div`
svg {
    position: absolute;
    top: calc(50% - 9px);
    left: 14px;
}
`;

const TabelContainer = styled.div`
background: #FFFFFF;
box-shadow: 0px 0px 10px #F4F4F4;
border-radius: 10px;
padding: 0 23px;
`;


export default Main
